import { StarFill, Star as StarEmpty, StarHalf } from "react-bootstrap-icons";

export function FiveStarRating({ rating }) {
  return (
    <div className={s.container}>
      <StarFill size={50} />
      <StarHalf size={50} />
      <StarEmpty size={50} />
    </div>
  );
}
